const footer = () => {
  return (
    <div className="footer">
      <button className="createAccount">Create Account</button>
      <p className="footer-info">
        Already have an account?{" "}
        <a href="https://www.linkedin.com/in/gabriel-mihai-924042234/">
          Log in
        </a>
      </p>
    </div>
  );
};

export default footer;
